import torch.nn.functional as F


# Neural Network for Hungry Geese

class TorusConv2d(nn.Module):
    def __init__(self, input_dim, output_dim, kernel_size, bn):
        super().__init__()
        self.edge_size = (kernel_size[0] // 2, kernel_size[1] // 2)  # (1, 1)
        self.conv = nn.Conv2d(input_dim, output_dim, kernel_size=kernel_size)  # (input_dim=31, outputdim=32)
        self.bn = nn.BatchNorm2d(output_dim) if bn else None  # output_dim=32

    def forward(self, x):
        h = torch.cat([x[:, :, :, -self.edge_size[1]:], x, x[:, :, :, :self.edge_size[1]]], dim=3)
        h = torch.cat([h[:, :, -self.edge_size[0]:], h, h[:, :, :self.edge_size[0]]], dim=2)
        h = self.conv(h)
        h = self.bn(h) if self.bn is not None else h
        return h


class GeeseNet005(nn.Module):
    def __init__(self):
        super().__init__()
        layers, filters = 12, 32
        self.channel = 28
        self.conv0 = TorusConv2d(self.channel, filters, (3, 3), True)
        self.blocks = nn.ModuleList([TorusConv2d(filters, filters, (3, 3), True) for _ in range(layers)])
        self.head_p = nn.Linear(filters, 4, bias=False)
        self.head_v = nn.Linear(filters * 2, 1, bias=False)

    def forward(self, x, _=None):
        # x = x[:, :self.channel, :, :]  # 変わらない。コメントアウトしておく
        h = F.relu_(self.conv0(x))
        for block in self.blocks:
            h = F.relu_(h + block(h))
        h_head = (h * x[:, :1]).view(h.size(0), h.size(1), -1).sum(-1)
        h_avg = h.view(h.size(0), h.size(1), -1).mean(-1)
        p = self.head_p(h_head)
        v = torch.tanh(self.head_v(torch.cat([h_head, h_avg], 1)))

        return {'policy': p, 'value': v}


# Input for Neural Network

class MakeInput:
    NUM_AGENTS = 4
    submit = True

    next_position_map = {}
    for pos in range(77):
        position = []
        position.append((11 * (1 + pos // 11) + pos % 11) % 77)
        position.append((11 * (-1 + pos // 11) + pos % 11) % 77)
        position.append((11 * (pos // 11) + (pos + 1) % 11) % 77)
        position.append((11 * (pos // 11) + (pos - 1) % 11) % 77)
        next_position_map[pos] = set(position)

    def make_input(self, obses):
        self.obs_list = obses
        player = obses[-1]['index']
        cube = self.observation(player)
        return cube

    def centerize(self, b):
        """
        b: (34, 7, 11)
        """
        dy, dx = np.where(b[0])
        if len(dy) == 0 or len(dx) == 0:
            return b
        else:
            centerize_y = (np.arange(7) - 3 + dy[0]) % 7
            centerize_x = (np.arange(11) - 5 + dx[0]) % 11

            b = b[:, centerize_y, :]
            b = b[:, :, centerize_x]

            return b

    def get_init_cube(self, player, obs, obs_prev):
        b = np.zeros((self.NUM_AGENTS * 4 + 1, 7 * 11), dtype=np.float32)

        for p, geese in enumerate(obs['geese']):
            # head position
            for pos in geese[:1]:
                b[0 + (p - player) % self.NUM_AGENTS, pos] = 1

            # tip position
            for pos in geese[-1:]:
                b[4 + (p - player) % self.NUM_AGENTS, pos] = 1

            # whole position
            for pos in geese:
                b[8 + (p - player) % self.NUM_AGENTS, pos] = 1

        # previous head position
        if obs_prev:
            for p, geese in enumerate(obs_prev['geese']):
                for pos in geese[:1]:
                    b[12 + (p - player) % self.NUM_AGENTS, pos] = 1

        # food
        for pos in obs['food']:
            b[16, pos] = 1

        init_cube = b.reshape(-1, 7, 11)

        return init_cube

    def get_reverse_cube(self, player, obs):
        """
        尻尾から順番に
         1, 0.9, 0.8, ...
        という並びのcube
        """
        b = np.zeros((self.NUM_AGENTS, 7 * 11), dtype=np.float32)

        for p, geese in enumerate(obs['geese']):
            # whole position reverse
            num_reverse = 0
            for pos in geese[::-1]:
                b[(p - player) % self.NUM_AGENTS, pos] = 1 - num_reverse * 0.1
                num_reverse += 1
        cube = b.reshape(-1, 7, 11)
        return cube

    def get_next_tip_possibility(self, player, obs):
        """お尻がある可能性のある場所"""
        b = np.zeros((4, 7 * 11), dtype=np.float32)
        step = obs['step']

        # foodを食べる可能性があるか。
        eat_food_possibility = defaultdict(int)
        for p, geese in enumerate(obs['geese']):
            for pos in geese[:1]:
                if not self.next_position_map[pos].isdisjoint(obs['food']):
                    eat_food_possibility[p] = 1

        if (step % 40) == 39:  # 1つ短くなる
            for p, geese in enumerate(obs['geese']):
                if eat_food_possibility[p]:  # 食べる可能性があり
                    for pos in geese[-3:-1]:
                        b[(p - player) % self.NUM_AGENTS, pos] = 1
                else:  # 食べる可能性なし
                    for pos in geese[-3:-2]:
                        b[(p - player) % self.NUM_AGENTS, pos] = 1
        else:  # 1つ短くならない
            for p, geese in enumerate(obs['geese']):
                if eat_food_possibility[p]:  # 食べる可能性があり
                    for pos in geese[-2:]:
                        b[(p - player) % self.NUM_AGENTS, pos] = 1
                else:  # 食べる可能性なし
                    for pos in geese[-2:-1]:
                        b[(p - player) % self.NUM_AGENTS, pos] = 1
        cube = b.reshape(-1, 7, 11)
        return cube

    def get_next_disappear_cube(self, player, obs):
        """
        次になくなる場所: 1
        次になくなる可能性のある場所: 0.5
        """
        b = np.zeros((4, 7 * 11), dtype=np.float32)
        step = obs['step']

        # foodを食べる可能性があるか。
        eat_food_possibility = defaultdict(int)
        for p, geese in enumerate(obs['geese']):
            for pos in geese[:1]:
                if not self.next_position_map[pos].isdisjoint(obs['food']):
                    eat_food_possibility[p] = 1

        if (step % 40) == 39:  # 1つ短くなる
            for p, geese in enumerate(obs['geese']):
                if eat_food_possibility[p]:  # 尻尾が1、尻尾の１つ前0.5
                    for pos in geese[-1:]:
                        b[(p - player) % self.NUM_AGENTS, pos] = 1
                    for pos in geese[-2:-1]:
                        b[(p - player) % self.NUM_AGENTS, pos] = 0.5
                else:  # 食べる可能性なし -> 尻尾が1, 尻尾の1つ前1
                    for pos in geese[-2:]:
                        b[(p - player) % self.NUM_AGENTS, pos] = 1
        else:  # 1つ短くならない
            for p, geese in enumerate(obs['geese']):
                if eat_food_possibility[p]:  # 食べる可能性があり -> 尻尾を0.5 
                    for pos in geese[-1:]:
                        b[(p - player) % self.NUM_AGENTS, pos] = 0.5
                else:  # 食べる可能性なし # 尻尾を1
                    for pos in geese[-1:]:
                        b[(p - player) % self.NUM_AGENTS, pos] = 1
        cube = b.reshape(-1, 7, 11)
        return cube

    def get_step_cube_v2(self, obs):
        """
        step0: 0, step199: 1
        step0: 0, step39 + 40n: 1
        """
        cube = np.zeros((1, 7, 11), dtype=np.float32)
        step = obs['step']
        cube[:, :, :5] = (step % 200) / 199
        cube[:, :, 5:] = (step % 40) / 39

        return cube

    def get_length_cube(self, obs, player):
        cube = np.zeros((2, 7, 11), dtype=np.float32)

        my_length = len(obs['geese'][player])
        opposite1_length = len(obs['geese'][(player + 1) % self.NUM_AGENTS])
        opposite2_length = len(obs['geese'][(player + 2) % self.NUM_AGENTS])
        opposite3_length = len(obs['geese'][(player + 3) % self.NUM_AGENTS])

        cube[0] = my_length / 10
        max_opposite_length = max(opposite1_length, opposite2_length, opposite3_length)
        cube[1, :, 0:2] = (my_length - max_opposite_length) / 10
        cube[1, :, 2:5] = (my_length - opposite1_length) / 10
        cube[1, :, 5:8] = (my_length - opposite2_length) / 10
        cube[1, :, 8:11] = (my_length - opposite3_length) / 10
        return cube

    def observation(self, player=None):
        if player is None:
            player = 0
        if self.submit:
            obs = self.obs_list[-1]
        elif not self.submit:
            obs = self.obs_list[-1][0]['observation']

        if len(self.obs_list) > 1:
            if self.submit:
                obs_prev = self.obs_list[-2]
            elif not self.submit:
                obs_prev = self.obs_list[-2][0]['observation']
        else:
            obs_prev = None

        init_cube = self.get_init_cube(player, obs, obs_prev)  # (self.NUM_AGENTS * 4 + 1, 7, 11)  # 0~16
        reverse_cube = self.get_reverse_cube(player, obs)  # (self.NUM_AGENTS, 7, 11)  # 17~20
        # next_tip_possibility = self.get_next_tip_possibility(player, obs)  # (4, 7, 11)  # 21~24
        next_disappear_cube = self.get_next_disappear_cube(player, obs)  # (4, 7, 11)  # 21~24
        step_cube = self.get_step_cube_v2(obs)  # (1, 7, 11)  # 25
        length_cube = self.get_length_cube(obs, player)  # (2, 7, 11)  # 26~27

        # 17 + 4 + 4 + 1 + 2 = 28
        if False:  # centerizeしない
            cube = np.concatenate([init_cube, reverse_cube,
                                   next_disappear_cube,
                                   step_cube, length_cube], axis=0)
        else:  # centerizeする
            cube_board = np.concatenate([init_cube, reverse_cube,
                                         next_disappear_cube], axis=0)
            cube_board = self.centerize(cube_board)  # 中央に寄せる
            cube_info = np.concatenate([step_cube, length_cube], axis=0)
        return cube_board, cube_info


# Load PyTorch Model
PARAM = b''

state_dict = pickle.loads(bz2.decompress(base64.b64decode(PARAM)))
model = GeeseNet005()
model.load_state_dict(state_dict)
model.eval()


def identity(image):
    return image.copy(), [0, 1, 2, 3]


def horizontal_flip(image):
    image = image[:, :, ::-1]
    return image.copy(), [0, 1, 3, 2]


def vertical_flip(image):
    image = image[:, ::-1, :]
    return image.copy(), [1, 0, 2, 3]


def horizontal_vertical_flip(image):
    image, _ = horizontal_flip(image)
    image, _ = vertical_flip(image)
    return image.copy(), [1, 0, 3, 2]


# Main Function of Agent
obses = []

def predict_action(cube_board, transform, cube_info=None):
    cube_board, slices = transform(cube_board)
    if cube_info is not None:
        cube = np.concatenate([cube_board, cube_info], axis=0)
    else:
        cube = cube_board

    with torch.no_grad():
        cube_tensor = torch.from_numpy(cube).unsqueeze(0)
        out = model(cube_tensor)
    p = out['policy'].squeeze(0).detach().numpy()
    p = p[slices]
    return p


def agent(obs, _):
    obses.append(obs)
    make_input = MakeInput()
    cube_board, cube_info = make_input.make_input(obses)

    p_i = predict_action(cube_board, identity, cube_info)
    p_horizontal = predict_action(cube_board, horizontal_flip, cube_info)
    p_vertical = predict_action(cube_board, vertical_flip, cube_info)
    p_horizontal_vertical = predict_action(cube_board, horizontal_vertical_flip, cube_info)

    actions = ['NORTH', 'SOUTH', 'WEST', 'EAST']

    return actions[np.argmax(p_i + p_horizontal + p_vertical + p_horizontal_vertical)]
